Sec={afterContentLoad:function(type,elements,listener){const referrer=document.referrer;let domainName="";if(referrer){try{const referrerUrl=new URL(referrer);domainName=referrerUrl.hostname.replace("www.","").split(".")[0]}catch(e){domainName="Neznámá doména"}}else{domainName="Neznámá doména"}document.getElementById("domain-name").textContent=`Název domény: ${domainName}`}};document.addEventListener("DOMContentLoaded",function(){Sec.afterContentLoad()});